db.contents.findOneAndUpdate({ _id: ObjectId("5de8ecf92bf37b7aa5e93403") }, { '$setOnInsert': { createdAt: new Date("Mon, 23 Dec 2019 09:16:10 GMT") }, '$set': { contentType: 'NEWS', title: 'IMFs new terms for Kenya $1.5b standby loan', description: 'The International Monetary Fund has introduced a set of new conditions for Kenya to access its $1.5 billion precautionary loan that was suspended in September last year, barely weeks after the country scrapped control of interest rates in compliance with the international lenders demands.\n\nAn IMF team that visited Nairobi between November 18 and 22 wants the Treasury to cut the rising budget deficit which stood at 7.7 per cent of GDP in the 2018/2019 financial year. \n\nThe fund also wants the government to implement tax and expenditure reforms that do not hurt private sector investments and stifle economic growth, before the resumption of talks planned for early next year. \n\nThe new conditions are set to throw a spanner in the governments plans to access funding from the IMF, including the critical precautionary loan to cushion the shilling from external economic shocks. \n\nProgress in this direction (reduction of fiscal deficit), including the design of tax and expenditure reforms that support a growth-friendly fiscal consolidation, would be important to anchor a new Fund-supported programme, said the IMF in a statement after the visit which was led by Benedict Clements.\n\nThe IMF says it held talks with acting Treasury Cabinet Secretary Ukur Yatani the Central Bank of Kenya Governor Dr Patrick Njoroge, the Head of Public Service Dr Joseph Kinyua among other senior government officials.\n\nThe Fund officials also met representatives of the private sector and development partners. The two-year (March 2016-March 2018) standby loan was approved by the IMF board to help cushion the Kenyan shilling from unforeseen economic shocks that could distort the countrys balance of payments position.\n\nThe programme was extended by six months in March 2018 after Kenya was unable to complete its programme reviews due to the repeated 2017 General Election.\n\nThe East African', starring: undefined, director: undefined, tags: [ ObjectId("5deb723616c2ad315f2d02a5") ], isSeries: false, categories: [ ObjectId("5de8a19612f1876c9365ea47") ], subCategories: [ ObjectId("5de8db2acc446376c1110e83") ], country: [ ObjectId("5de8b686641f4253ad09d301"), ObjectId("5de8b686641f4253ad09d253"), ObjectId("5de8b686641f4253ad09d27a"), ObjectId("5de8b686641f4253ad09d2b9"), ObjectId("5de8b686641f4253ad09d2ca"), ObjectId("5de8b686641f4253ad09d2cf"), ObjectId("5de8b686641f4253ad09d2f8"), ObjectId("5de8b686641f4253ad09d2ff") ], language: undefined, isFree: true, priceDetail: undefined, createdBy: undefined, releaseDate: undefined, isFreeForAzam: true, boundingBox: undefined, cdnID: undefined, duration: undefined, imageThumb: 'https://s3.eu-west-1.amazonaws.com/com.azamtv2019/cbk_1575453038-911dc7b1ff78530786d9addc40889546.jpg', packageID: [], vodType: undefined, series: [], images: [], videoURL: undefined, isEpisode: false, referenceChannelID: null, updatedAt: new Date("Mon, 23 Dec 2019 09:16:10 GMT") } }, { new: false, upsert: false, projection: {} })
